import 'package:auto_route/annotations.dart';import 'package:mehonot_admin/presentation/widgets/containers/feedback_container.dart';import '../../../manager/models/Feedback/feedback_md.dart';import '../../template/template.dart';@RoutePage()class FeedbackListPage extends StatefulWidget {  const FeedbackListPage({Key? key}) : super(key: key);  @override  State<FeedbackListPage> createState() => _FeedbackListPageState();}class _FeedbackListPageState extends State<FeedbackListPage> {  @override  Widget build(BuildContext context) {    return StoreConnector<AppState, AppState>(        converter: (store) => store.state,        builder: (_, state) {          return Padding(              padding: EdgeInsets.all(20.w),              child: SingleChildScrollView(                  child: SpacedColumn(                crossAxisAlignment: CrossAxisAlignment.start,                verticalSpace: 20,                children: [                  SizedText(                      text:                          "Feedback list : ${state.initState.feedbackList.length}",                      textStyle: ThemeTextRegular.k12),                  _buildFeedbackList(state),                ],              )));        });  }  Widget _buildFeedbackList(AppState state) {    List<Widget> list = [];    List<FeedbackMd> feedbackList = state.initState.feedbackList;    for (int i = 0; i < feedbackList.length; i++) {      list.add(FeedbackContainer(        onDelete: () {},        feedbackMd: feedbackList[i],      ));    }    return SpacedColumn(      crossAxisAlignment: CrossAxisAlignment.start,      verticalSpace: 20,      children: list,    );  }}